import { List, ListItemButton, ListItemIcon } from "@material-ui/core";
import React from "react";

export default function SideBar() {
  return (
    <>
      <List>
        <ListItemButton alignItems="center">
          <ListItemIcon sx={{ width: 200 }}>
            <img
              src="https://logodix.com/logo/1789832.png"
              alt=""
              className="w-100"
            />
          </ListItemIcon>
        </ListItemButton>
      </List>
    </>
  );
}
